configVersion: 0.1.2
app:
  httpWeb:
    enabled: true
    host:
      address: "[::]"
      port: 3000
    skin: default
  dnsProxy:
    host:
      address: "[::]"
      port: 3553
    upstream:
      address: 127.0.0.1
      port: 53
    disableRemap53: false
    disableFakePTR: false
    disableDropAAAA: false
  netfilter:
    iptables:
      chainPrefix: MT_
    ipset:
      tablePrefix: mt_
